/* eslint-disable no-undef */
const data = [
  {
    id: 1,
    title: abc123,
    descriotion: desc123,
  },
  {
    id: 2,
    title: a2bc123,
    descriotion: d2esc123,
  },
  {
    id: 3,
    title: a3bc123,
    descriotion: d3esc123,
  },
  {
    id: 4,
    title: a4bc123,
    descriotion: de4sc123,
  },
  {
    id: 5,
    title: a5bc123,
    descriotion: de5sc123,
  },
];
export default data;
